import React, { Component } from "react";
// import "./css/main.css";

export class App extends Component {
  render() {
    return (
      <div className="App">
        <h1> Apa </h1>
        <img
          src="https://c.ndtvimg.com/2019-08/k8519lf8_bugatti-centodieci-unveiled-at-pebble-beach-car-show_625x300_17_August_19.jpg"
          alt="image banner"
        />
      </div>
    );
  }
}

export default App;
